import React from "react";
import "./bar.css";

function Icon(props) {
  return (
    <>
      <div className="icon">
        <a href={props.link}>
          <i class={props.faClass}></i>
        </a>
      </div>
    </>
  );
}

const Header = () => {
  return (
    <>
      <div className="wrapper">
        <span>Welcome to Zuiz Business Services</span>
        <div className="icon-container">
          <div className="bar"></div>
          <a href="https://www.youtube.com">Follow Us</a>
          <div className="icons">
            <Icon
              link="https://www.facebook.com"
              faClass="fa-brands fa-facebook-f"
            />
            <Icon
              link="https://www.instagram.com"
              faClass="fa-brands fa-instagram"
            />
            <Icon
              link="https://www.twitter.com"
              faClass="fa-brands fa-twitter"
            />
            <Icon
              link="https://www.linkedin.com"
              faClass="fa-brands fa-linkedin-in"
            />
          </div>
        </div>
      </div>
    </>
  );
};

export default Header;
